import React from 'react'
import './App.css'

const App = () => {
    return(
        <>
            <div className='cards'>
                <h1 className='heading_style'>List Of Top 5 Netflix Series In 2022</h1>
                <div className='card'>
                    <img src='https://wallpapercave.com/wp/wp4056410.jpg' alt='Dark' className='card_img' />
                    <div className='card_info'>
                        <span className='card_category'>A Netflix Original Series</span>
                        <h3 className='card_title'>Dark</h3>
                        <button className='button'>Watch Now</button>
                    </div>
                </div>
            </div>
        </>
    );
}

export default App;
